message:
➡️ "A censura imposta pelo TSE é inconstitucional, avalia Marco Aurélio, que lembra a vedação à criação de qualquer tipo de legislação sobre a liberdade de imprensa. 'O art 220 (da CF) tem uma cláusula pedagógica que impede que se aprove dispositivo legal que implique embaraço à liberdade de informação jornalística', explicou."

@flamaverdenacionalista 

